import React from 'react';
import { Card } from 'antd';
import StoryComment from '../components/StoryComment';

function StoryPage({}){

    return (
        <div className="content">
            <Card
                style={{
                    marginTop: 16,
                }}
                loading={false}
            >
                <Meta
                    title="Card title"
                />
                <span className="rating">2</span>
                <Divider type="vertical" />
                <span className="author">3</span>
                <Divider type="vertical" />
                <span className="date">4</span>
            </Card>
            <div className="comments">
                <StoryComment />
                <StoryComment />
                <StoryComment />
                <StoryComment />
                <StoryComment />
            </div>
        </div>
    );
}
